%[text] %[text:anchor:T_CF367ECB] # Create Detailed House Using Custom Library Components
%[text] Copyright 2025 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] In this workflow, you will construct a house using custom components. These components leverage the same functionality as the custom components generated in other workflows ([Building Heat Load Estimation,](file:./BuildingHeatLoadEstimation.mlx) [Create Building Model with Solar Load](file:./CreateBuildingModelWithSolarLoad.mlx), etc). Find custom components listed under `Simscape Custom Components` in the `Simulink Library Browser`. 
%[text]{"align":"center"} ![](text:image:701a)
%[text] %[text:anchor:H_A31224A4] ## Build the Model
%[text] Use the library elements to build a simple one room house, as described in the picture below. The house is south facing and has one room. The room air volume is divided into smaller control volumes to add more details to the model. In this example, the room air volume is divided into (3,2,2) parts in the (x,y,z) direction. 
%[text]{"align":"center"} ![DetailedHouseSchematic.png](text:image:657e)
%[text] The `Room Volume` library block models these discretized air volumes. The room has four walls, modeled using the `Wall External` block. The wall orientation is specified in the section *Surface Orientation* of the `Wall External` block mask. See [Create Building Model with Solar Load](file:./CreateBuildingModelWithSolarLoad.mlx) for convention used for geographical direction: positive x is east, positive y is north, negative y is south, and negative x is west, on a 2D xy plane, as shown in the picture below. So, a south facing vertical wall is specified as having parameters **Unit outward normal direction vector** as \[0,-1\] and **Surface angle wrt ground** as 90 degrees, in the `Wall External` block mask.
%[text]{"align":"center"} ![directionConventionUsed.png](text:image:9aa9)
%[text] The picture below shows the model implementation in Simscape. The model is externally connected to a solar load. In this workflow, you learn how to evaluate the cooling and/or heating requirements for this house. The `Temperature Source (LUT)` and the `Solar Radiation (LUT)` block specify the ambient conditions.
%[text]{"align":"center"} ![](text:image:1498)
%[text] The `Solar Radiation (LUT)` block specifies the solar radiation value on a specified date and time. See how the above model is constructed in the [`DetailedHouse` SLX](file:./DetailedHouseModel/DetailedHouse.slx) file.
%[text] %[text:anchor:H_91BF144F] ## Setup Model
%[text] Run the `DetailedHouseParameters` live script and display the the simulation duration in hours.
run("DetailedHouseParameters.mlx");
disp(strcat("Number of hours of simulation ~ ",num2str(house.operational.datetime.numOfHourData),"hrs")) %[output:25bbad64]
%[text] The workspace variable `house` contains all model parameter data. 
%[text] Load the system model.
load_system("DetailedHouse.slx");
%[text] Set desired room temperature for HVAC.
setT = simscape.Value(295,"K");
set_param("DetailedHouse/Tset","Value",num2str(value(setT,"K")));
%[text] The model provides heat to the room (for heating or cooling) based on the difference in the maximum room temperature and the room desired set point temperature, though the port ***S***.
%[text] %[text:anchor:H_4672D37F] ## Run Simulation
%[text] Run the model.
simRes = sim("DetailedHouse.slx");
%%
%[text] %[text:anchor:H_A5ED077B] ## Calculate HVAC Requirement
%[text] Use the house data to calculate and display the HVAC requirement.
simRes.AvgPow = getAveragePower(simRes.DetailedHouseScopeData.extractTimetable);
disp(strcat("Average Cooling Requirement ~ ",num2str(abs(simRes.AvgPow)),"W")); %[output:660f4e98]

